package Algorithm.HackerRank.HackerRank_Special_String_Again;

public class Solution_DP_Memory_Overflow {

    // Complete the substrCount function below.
    static long substrCount(int n, String s) {
        boolean[][] dp = new boolean[n][n];
        long result = 0;

        for (int j = 0; j < n; j++) {
            for (int i = 0; i <= j; i++) {
                if (s.charAt(i) == s.charAt(j) &&
                        (j - i <= 2 ||
                                s.charAt(i) == s.charAt(i + 1) && s.charAt(j) == s.charAt(j - 1) && dp[i + 1][j - 1])) {
                    dp[i][j] = true;
                    result++;
                }

            }
        }

        return result;

    }

    public static void main(String[] args) {
        System.out.println(Solution_DP_Memory_Overflow.substrCount(65476,
                ""));
    }
}
